import{r,o as t,c as n,a,d as o,F as c,e,b as d}from"./app.e5ee52ef.js";import{_ as s}from"./plugin-vue_export-helper.21dcd24c.js";const h={},i=e('<h1 id="java" tabindex="-1"><a class="header-anchor" href="#java" aria-hidden="true">#</a> Java</h1><h1 id="\u7EE7\u627F" tabindex="-1"><a class="header-anchor" href="#\u7EE7\u627F" aria-hidden="true">#</a> \u7EE7\u627F</h1><p>\u9762\u5411\u5BF9\u8C61\u7279\u5F81</p><p>OPP \u7279\u5F81\u4E8C\uFF1A\u7EE7\u627F\u6027 \u65B9\u6CD5\u7684\u91CD\u5199 \u56DB\u79CD\u8BBF\u95EE\u6743\u9650\u4FEE\u9970\u7B26 \u5173\u952E\u5B57: super \u5B50\u7C7B\u5BF9\u8C61\u5B9E\u4F8B\u5316\u8FC7\u7A0B OPP \u7279\u5F81\u4E09\uFF1A\u591A\u6001\u6027 \u7EE7\u627F\u6027</p><p>\u4E00\uFF1A\u7EE7\u627F\u6027\u7684\u597D\u5904</p><p>\u51CF\u5C11\u4EE3\u7801\u7684\u5197\u4F59\uFF0C\u63D0\u9AD8\u4E86\u4EE3\u7801\u7684\u590D\u7528\u6027 \u4FBF\u4E8E\u529F\u80FD\u7684\u6269\u5C55 \u4E3A\u4E4B\u540E\u591A\u6001\u6027\u7684\u4F7F\u7528\uFF0C\u63D0\u4F9B\u4E86\u524D\u63D0 \u4E8C\uFF1A\u7EE7\u627F\u6027\u7684\u683C\u5F0F: class A extends B{} A: \u5B50\u7C7B\uFF0C\u6D3E\u751F\u7C7B\uFF0Csubclass B\uFF1A\u7236\u7C7B\uFF0C\u8D85\u7C7B\uFF0C\u57FA\u7C7B\uFF0Csuperclass</p><p>\u4F53\u73B0\uFF1A\u4E00\u65E6\u5B50\u7C7B A \u7EE7\u627F\u7236\u7C7B B \u4EE5\u540E\uFF0C\u5B50\u7C7B A \u4E2D\u5C31\u83B7\u53D6\u4E86\u7236\u7C7B B \u4E2D\u58F0\u660E\u7684\u6240\u6709\u7684\u5C5E\u6027\u548C\u65B9\u6CD5\u3002 \u7279\u522B\u7684\uFF0C\u7236\u7C7B\u4E2D\u58F0\u660E\u4E3A private \u7684\u5C5E\u6027\u6216\u65B9\u6CD5\uFF0C\u5B50\u7C7B\u7EE7\u627F\u7236\u7C7B\u4EE5\u540E\uFF0C\u4ECD\u7136\u8BA4\u4E3A\u83B7\u53D6\u4E86\u7236\u7C7B\u4E2D\u79C1\u6709\u7684\u7ED3\u6784\u3002 \u53EA\u6709\u56E0\u4E3A\u5C01\u88C5\u6027\u7684\u5F71\u54CD\uFF0C\u4F7F\u5F97\u5B50\u7C7B\u4E0D\u80FD\u76F4\u63A5\u8C03\u7528\u7236\u7C7B\u7684\u7ED3\u6784\u800C\u5DF2\u3002</p><p>\u5B50\u7C7B\u7EE7\u627F\u7236\u7C7B\u4EE5\u540E\uFF0C\u8FD8\u53EF\u4EE5\u58F0\u660E\u81EA\u5DF1\u7279\u6709\u7684\u5C5E\u6027\u6216\u65B9\u6CD5\uFF0C\u5B9E\u73B0\u529F\u80FD\u7684\u62D3\u5C55\u3002\u5B50\u7C7B\u548C\u7236\u7C7B\u7684\u5173\u7CFB\uFF0C\u4E0D\u540C\u4E8E\u5B50\u96C6\u548C\u96C6\u5408\u7684\u5173\u7CFB\u3002 extends: \u5EF6\u5C55\uFF0C\u6269\u5C55</p><p>\u4E09\uFF1AJava \u4E2D\u5173\u4E8E\u7EE7\u627F\u6027\u7684\u89C4\u5B9A\uFF1A</p><p>\u4E00\u4E2A\u7C7B\u53EF\u4EE5\u88AB\u591A\u4E2A\u5B50\u7C7B\u7EE7\u627F\u3002 Java \u4E2D\u7C7B\u7684\u5355\u7EE7\u627F\u6027\uFF1A\u4E00\u4E2A\u7C7B\u53EA\u80FD\u6709\u4E00\u4E2A\u7236\u7C7B \u5B50\u7236\u7C7B\u662F\u76F8\u5BF9\u7684\u6982\u5FF5 \u5B50\u7C7B\u76F4\u63A5\u7EE7\u627F\u7684\u7236\u7C7B\uFF0C\u79F0\u4E3A\uFF1A\u76F4\u63A5\u7236\u7C7B\uFF0C\u95F4\u63A5\u7EE7\u627F\u7684\u7236\u7C7B\u79F0\u4E3A\uFF1A\u95F4\u63A5\u7236\u7C7B \u5B50\u7C7B\u7EE7\u627F\u7236\u7C7B\u4EE5\u540E\uFF0C\u5C31\u83B7\u53D6\u4E86\u76F4\u63A5\u7236\u7C7B\u4EE5\u53CA\u6240\u6709\u95F4\u63A5\u7236\u7C7B\u4E2D\u58F0\u660E\u7684\u5C5E\u6027\u548C\u65B9\u6CD5 \u56DB\uFF1A</p><p>\u5982\u679C\u6211\u4EEC\u6CA1\u6709\u663E\u5F0F\u7684\u58F0\u660E\u4E00\u4E2A\u7C7B\u7684\u7236\u7C7B\u7684\u8BDD\uFF0C\u5219\u6B64\u7C7B\u7EE7\u627F\u4E8E java.lang.Object \u7C7B \u6240\u6709\u7684 java \u7C7B (\u9664 java.lang.Object \u7C7B\u4E4B\u5916\uFF09\u90FD\u76F4\u63A5\u6216\u95F4\u63A5\u7684\u7EE7\u627F\u4E8E java.lang.Object \u7C7B \u610F\u5473\u7740\uFF0C\u6240\u6709\u7684 java \u7C7B\u5177\u6709 java.lang.Object \u7C7B\u58F0\u660E\u7684\u529F\u80FD\u3002</p><h2 id="\u91CD\u5199" tabindex="-1"><a class="header-anchor" href="#\u91CD\u5199" aria-hidden="true">#</a> \u91CD\u5199</h2><p>\u5B9A\u4E49 \u5728\u5B50\u7C7B\u4E2D\u53EF\u4EE5\u6839\u636E\u9700\u8981\u5BF9\u4ECE\u7236\u7C7B\u4E2D\u7EE7\u627F\u6765\u7684\u65B9\u6CD5\u8FDB\u884C\u6539\u9020\uFF0C\u4E5F\u79F0\u4E3A\u65B9\u6CD5\u7684\u91CD\u7F6E\u3001\u8986\u76D6\u3002\u5728\u7A0B\u5E8F\u6267\u884C\u65F6\uFF0C\u5B50\u7C7B\u7684\u65B9\u6CD5\u5C06\u8986\u76D6\u7236\u7C7B\u7684\u65B9\u6CD5\u3002</p><p>\u8981\u6C42 \u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u5FC5\u987B\u548C\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u5177\u6709\u76F8\u540C\u7684\u65B9\u6CD5\u540D\u79F0\u3001\u53C2\u6570\u5217\u8868</p><p>\u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B\u4E0D\u80FD\u5927\u4E8E\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B</p><p>\u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u4F7F\u7528\u7684\u8BBF\u95EE\u6743\u9650\u4E0D\u80FD\u5C0F\u4E8E\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8BBF\u95EE\u6743\u9650\u3002</p><p>\u6CE8\u610F\uFF1A\u5B50\u7C7B\u4E0D\u80FD\u91CD\u5199\u7236\u7C7B\u4E2D\u58F0\u660E\u4E3A private \u6743\u9650\u7684\u65B9\u6CD5</p><p>\u5B50\u7C7B\u65B9\u6CD5\u629B\u51FA\u7684\u5F02\u5E38\u4E0D\u80FD\u5927\u4E8E\u7236\u7C7B\u88AB\u91CD\u5199\u65B9\u6CD5\u7684\u5F02\u5E38</p><p>\u6CE8\u610F\uFF1A \u5B50\u7C7B\u4E0E\u7236\u7C7B\u4E2D\u540C\u540D\u540C\u53C2\u6570\u7684\u65B9\u6CD5\u5FC5\u987B\u540C\u65F6\u58F0\u660E\u4E3A\u975E static \u7684 (\u5373\u4E3A\u91CD\u5199)\uFF0C\u6216\u8005\u540C\u65F6\u58F0\u660E\u4E3A static \u7684\uFF08\u4E0D\u662F\u91CD\u5199\uFF09\u3002\u56E0\u4E3A static \u65B9\u6CD5\u662F\u5C5E\u4E8E\u7C7B\u7684\uFF0C\u5B50\u7C7B\u65E0\u6CD5\u8986\u76D6\u7236\u7C7B\u7684\u65B9\u6CD5\u3002</p><p>\u5177\u4F53\u8BF4\u660E</p><p>\u91CD\u5199\uFF1A\u5B50\u7C7B\u7EE7\u627F\u7236\u7C7B\u4EE5\u540E\uFF0C\u53EF\u4EE5\u5BF9\u7236\u7C7B\u4E2D\u540C\u540D\u540C\u53C2\u6570\u7684\u65B9\u6CD5\uFF0C\u8FDB\u884C\u8986\u76D6\u64CD\u4F5C</p><p>\u5E94\u7528\uFF1A\u91CD\u5199\u4EE5\u540E\uFF0C\u5F53\u521B\u5EFA\u5B50\u7C7B\u5BF9\u8C61\u4EE5\u540E\uFF0C\u901A\u8FC7\u5B50\u7C7B\u5BF9\u8C61\u8C03\u7528\u5B50\u7236\u7C7B\u4E2D\u7684\u540C\u540D\u540C\u53C2\u6570\u7684\u65B9\u6CD5\u65F6\uFF0C\u5B9E\u9645\u6267\u884C\u7684\u662F\u5B50\u7C7B\u91CD\u5199\u7236\u7C7B\u7684\u65B9\u6CD5</p><p>\u91CD\u5199\u7684\u89C4\u5B9A\uFF1A</p><p>\u65B9\u6CD5\u7684\u58F0\u660E\uFF1A\u6743\u9650\u4FEE\u9970\u7B26 \u8FD4\u56DE\u503C\u7C7B\u578B \u65B9\u6CD5\u540D (\u5F62\u53C2\u5217\u8868) { //\u65B9\u6CD5\u4F53 }</p><p>\u7EA6\u5B9A\u4FD7\u79F0\uFF1A\u5B50\u7C7B\u4E2D\u7684\u53EB\u91CD\u5199\u7684\u65B9\u6CD5\uFF0C\u7236\u7C7B\u4E2D\u7684\u53EB\u88AB\u91CD\u5199\u7684\u65B9\u6CD5</p><p>\u2460 \u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u65B9\u6CD5\u540D\u548C\u5F62\u53C2\u5217\u8868\u4E0E\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u65B9\u6CD5\u540D\u548C\u5F62\u53C2\u5217\u8868\u76F8\u540C</p><p>\u2461 \u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u6743\u9650\u4FEE\u9970\u7B26\u4E0D\u5C0F\u4E8E\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u6743\u9650\u4FEE\u9970\u7B26</p><p>\u7279\u6B8A\u60C5\u51B5\uFF1A\u5B50\u7C7B\u4E0D\u80FD\u91CD\u5199\u7236\u7C7B\u4E2D\u58F0\u660E\u4E3A private \u6743\u9650\u7684\u65B9\u6CD5</p><p>\u2462 \u8FD4\u56DE\u503C\u7C7B\u578B\uFF1A</p><p>\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B\u662F void\uFF0C\u5219\u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B\u53EA\u80FD\u662F void</p><p>\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B\u662F A \u7C7B\u578B\uFF0C\u5219\u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B\u53EF\u4EE5\u662F A \u7C7B\u6216 A \u7C7B\u7684\u5B50\u7C7B</p><p>\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B\u662F\u57FA\u672C\u6570\u636E\u7C7B\u578B\uFF0C\u5219\u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u5FC5\u987B\u662F\u76F8\u540C\u7684\u7EA7\u522B\u6570\u636E\u7C7B\u578B (\u6BD4\u5982:double),\u5219\u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u7684\u8FD4\u56DE\u503C\u7C7B\u578B\u5FC5\u987B\u662F\u76F8\u540C\u7684\u7EA7\u522B\u6570\u636E\u7C7B\u578B (\u5FC5\u987B\u662F double)</p><p>\u2463 \u5B50\u7C7B\u91CD\u5199\u7684\u65B9\u6CD5\u629B\u51FA\u7684\u5F02\u5E38\u7C7B\u578B\u4E0D\u5927\u4E8E\u7236\u7C7B\u88AB\u91CD\u5199\u7684\u65B9\u6CD5\u629B\u51FA\u7684\u5F02\u5E38\u7C7B\u578B</p><h2 id="\u591A\u6001" tabindex="-1"><a class="header-anchor" href="#\u591A\u6001" aria-hidden="true">#</a> \u591A\u6001</h2><p>\u591A\u6001\u6027\uFF0C\u662F\u9762\u5411\u5BF9\u8C61\u4E2D\u6700\u91CD\u8981\u7684\u6982\u5FF5\uFF0C\u5728 JAVA \u4E2D\u7684\u4F53\u73B0\uFF1A \u5BF9\u8C61\u7684\u591A\u6001\u6027\uFF1A \u7236\u7C7B\u7684\u5F15\u7528\u6307\u5411\u5B50\u7C7B\u7684\u5BF9\u8C61 \u53EF\u4EE5\u76F4\u63A5\u5E94\u7528\u5728\u62BD\u8C61\u7C7B\u548C\u63A5\u53E3\u4E0A</p><p>Java \u5F15\u7528\u53D8\u91CF\u6709\u4E24\u4E2A\u7C7B\u578B\uFF1A\u7F16\u8BD1\u65F6\u7C7B\u578B \u548C \u8FD0\u884C\u65F6\u7C7B\u578B\u3002\u7F16\u8BD1\u65F6\u7C7B\u578B\u7531\u58F0\u660E\u8BE5\u53D8\u91CF\u65F6\u4F7F\u7528\u7684\u7C7B\u578B\u51B3\u5B9A\uFF0C\u8FD0\u884C\u65F6\u7C7B\u578B\u7531\u5B9E\u9645\u8D4B\u7ED9\u8BE5\u53D8\u91CF\u7684\u5BF9\u8C61\u51B3\u5B9A\u3002\u7B80\u79F0\uFF1A\u7F16\u8BD1\u65F6\uFF0C\u770B\u5DE6\u8FB9\uFF1B\u8FD0\u884C\u65F6\uFF0C\u770B\u53F3\u8FB9\u3002 \u82E5\u7F16\u8BD1\u65F6\u7C7B\u578B\u548C\u8FD0\u884C\u65F6\u7C7B\u578B\u4E0D\u4E00\u81F4\uFF0C\u5C31\u51FA\u73B0\u4E86\u5BF9\u8C61\u7684\u591A\u6001\u6027 (Polymorphism) \u591A\u6001\u60C5\u51B5\u4E0B\uFF0C&quot;\u770B\u5DE6\u8FB9&quot;: \u770B\u7684\u662F\u7236\u7C7B\u7684\u5F15\u7528 (\u7236\u7C7B\u4E2D\u4E0D\u5177\u5B50\u7C7B\u7279\u6709\u7684\u65B9\u6CD5) &quot;\u770B\u53F3\u8FB9&quot;: \u770B\u7684\u662F\u5B50\u7C7B\u7684\u5BF9\u8C61\uFF08\u5B9E\u9645\u8FD0\u884C\u7684\u662F\u5B50\u7C7B\u91CD\u5199\u7236\u7C7B\u7684\u65B9\u6CD5)</p><p>\u7406\u89E3\u591A\u6001\u6027\uFF1A\u53EF\u4EE5\u7406\u89E3\u4E3A\u4E00\u4E2A\u4E8B\u7269\u7684\u591A\u79CD\u5F62\u6001\u3002</p><p>\u4F55\u4E3A\u591A\u6001\u6027\uFF1A\u5BF9\u8C61\u7684\u591A\u6001\u6027\uFF1A\u7236\u7C7B\u7684\u5F15\u7528\u6307\u5411\u5B50\u7C7B\u7684\u5BF9\u8C61 (\u6216\u5B50\u7C7B\u7684\u5BF9\u8C61\u8D4B\u7ED9\u7236\u7C7B\u7684\u5F15\u7528)</p><p>\u591A\u6001\u7684\u4F7F\u7528\uFF1A\u865A\u62DF\u65B9\u6CD5\u8C03\u7528 \u6709\u4E86\u5BF9\u8C61\u7684\u591A\u6001\u6027\u4EE5\u540E\uFF0C\u6211\u4EEC\u5728\u7F16\u8BD1\u671F\uFF0C\u53EA\u80FD\u8C03\u7528\u7236\u7C7B\u4E2D\u58F0\u660E\u7684\u65B9\u6CD5\uFF0C\u4F46\u5728\u8FD0\u884C\u671F\uFF0C\u6211\u4EEC\u5B9E\u9645\u6267\u884C\u7684\u662F\u5B50\u7C7B\u91CD\u5199\u7236\u7C7B\u7684\u65B9\u6CD5\u3002 \u603B\u7ED3\uFF1A\u7F16\u8BD1\uFF0C\u770B\u5DE6\u8FB9; \u8FD0\u884C\uFF0C\u770B\u53F3\u8FB9\u3002</p><p>\u591A\u6001\u6027\u7684\u4F7F\u7528\u524D\u63D0\uFF1A1.\u7C7B\u7684\u7EE7\u627F\u5173\u7CFB\uFF0C2.\u65B9\u6CD5\u7684\u91CD\u5199</p><p>\u5BF9\u8C61\u7684\u591A\u6001\u6027\uFF1A\u53EA\u8BDD\u7528\u4E8E\u65B9\u6CD5\uFF0C\u4E0D\u9002\u7528\u4E8E\u5C5E\u6027 (\u7F16\u8BD1\u548C\u8FD0\u884C\u90FD\u770B\u5DE6\u8FB9)</p><p>\u82E5\u5B50\u7C7B\u91CD\u5199\u4E86\u7236\u7C7B\u65B9\u6CD5\uFF0C\u5C31\u610F\u5473\u7740\u5B50\u7C7B\u91CC\u5B9A\u4E49\u7684\u65B9\u6CD5\u5F7B\u5E95\u8986\u76D6\u4E86\u7236\u7C7B\u91CC\u80FD\u540C\u540D\u65B9\u6CD5\uFF0C\u7CFB\u7EDF\u5C06\u4E0D\u53EF\u80FD\u628A\u7236\u7C7B\u91CC\u7684\u65B9\u6CD5\u8F6C\u79FB\u5230\u5B50\u7C7B\u4E2D\u3002\u7F16\u8BD1\u770B\u5DE6\u8FB9\uFF0C\u8FD0\u884C\u770B\u53F3\u8FB9\u3002</p><p>\u5BF9\u4E8E\u5B9E\u4F8B\u53D8\u91CF\u5219\u4E0D\u5B58\u5728\u8FD9\u6837\u7684\u73B0\u8C61\uFF0C\u5373\u4F7F\u5B50\u7C7B\u91CC\u5B9A\u4E49\u4E86\u4E0E\u7236\u7C7B\u5B8C\u5168\u76F8\u540C\u7684\u5B9E\u4F8B\u53D8\u91CF\uFF0C\u8FD9\u4E2A\u5B9E\u4F8B\u53D8\u91CF\u4F9D\u7136\u4E0D\u53EF\u80FD\u8986\u76D6\u7236\u7C7B\u4E2D\u5B9A\u4E49\u7684\u5B9E\u4F8B\u53D8\u91CF\u3002\u7F16\u8BD1\u8FD0\u884C\u90FD\u770B\u5DE6\u8FB9\u3002</p><h2 id="\u5783\u573E\u56DE\u6536" tabindex="-1"><a class="header-anchor" href="#\u5783\u573E\u56DE\u6536" aria-hidden="true">#</a> \u5783\u573E\u56DE\u6536</h2>',44),l={href:"https://www.cnblogs.com/klvchen/articles/11758324.html",target:"_blank",rel:"noopener noreferrer"},u=d("Young GC \u548C Full GC"),g=e('<h3 id="\u65B0\u751F\u4EE3\u548C\u8001\u5E74\u4EE3" tabindex="-1"><a class="header-anchor" href="#\u65B0\u751F\u4EE3\u548C\u8001\u5E74\u4EE3" aria-hidden="true">#</a> \u65B0\u751F\u4EE3\u548C\u8001\u5E74\u4EE3</h3><p>\u5728 JVM \u8FD0\u884C\u7684\u65F6\u5019\uFF0C\u6700\u6838\u5FC3\u7684\u5185\u5B58\u533A\u57DF\uFF0C\u5176\u5B9E\u5C31\u662F\u5806\u5185\u5B58\uFF0C\u5728\u8FD9\u91CC\u4F1A\u653E\u5404\u79CD\u7CFB\u7EDF\u4E2D\u521B\u5EFA\u51FA\u6765\u7684\u5BF9\u8C61\u3002</p><p>\u800C\u4E14\u5806\u5185\u5B58\u91CC\u901A\u5E38\u90FD\u4F1A\u5212\u5206\u4E3A\u65B0\u751F\u4EE3\u548C\u8001\u5E74\u4EE3\u4E24\u4E2A\u5185\u5B58\u533A\u57DF\uFF0C\u5BF9\u8C61\u4E00\u822C\u6765\u8BF4\u90FD\u662F\u4F18\u5148\u653E\u5728\u65B0\u751F\u4EE3\u7684\u3002 \u901A\u5E38\u6765\u8BF4\u65B0\u751F\u4EE3\u4F1A\u6709\u4E00\u5757 Eden \u533A\u57DF\u7528\u6765\u521B\u5EFA\u5BF9\u8C61\uFF0C\u9ED8\u8BA4\u5360\u636E 80% \u7684\u5185\u5B58\uFF0C\u8FD8\u6709\u4E24\u5757 Survivor \u533A\u57DF\u7528\u6765\u653E\u5783\u573E\u56DE\u6536\u540E\u5B58\u6D3B\u4E0B\u6765\u7684\u5BF9\u8C61\uFF0C\u5206\u522B\u5360\u636E 10% \u7684\u5185\u5B58\u3002</p><h3 id="young-gc" tabindex="-1"><a class="header-anchor" href="#young-gc" aria-hidden="true">#</a> Young GC</h3><p><strong>\u5728\u5E74\u8F7B\u4EE3\uFF08\u4E5F\u53EF\u4EE5\u53EB\u505A\u65B0\u751F\u4EE3\uFF09\u5FEB\u8981\u585E\u6EE1\u7684\u65F6\u5019\uFF0C\u5C31\u4F1A\u89E6\u53D1\u5E74\u8F7B\u4EE3 gc\uFF08Young GC\uFF09\uFF0C\u4E5F\u5C31\u662F\u5BF9\u5E74\u8F7B\u4EE3\u8FDB\u884C\u5783\u573E\u56DE\u6536\uFF0C\u9700\u8981\u628A\u5E74\u8F7B\u4EE3\u91CC\u7684\u5783\u573E\u5BF9\u8C61\u90FD\u7ED9\u56DE\u6536\u6389\u3002</strong></p><p>\u4E00\u65E6\u8981\u5BF9\u65B0\u751F\u4EE3\u8FDB\u884C\u5783\u573E\u56DE\u6536\u4E86\uFF0C** \u6B64\u65F6\u4E00\u5B9A\u4F1A\u505C\u6B62\u7CFB\u7EDF\u7A0B\u5E8F\u7684\u8FD0\u884C **\uFF0C\u4E0D\u8BA9\u7CFB\u7EDF\u7A0B\u5E8F\u6267\u884C\u4EFB\u4F55\u4EE3\u7801\u903B\u8F91\u4E86\uFF0C\u8FD9\u4E2A\u53EB\u505A \u201CStop the World\u201D \u6B64\u65F6\u53EA\u80FD\u5141\u8BB8\u540E\u53F0\u7684\u5783\u573E\u56DE\u6536\u5668\u7684\u591A\u4E2A\u5783\u573E\u56DE\u6536\u7EBF\u7A0B\u53BB\u5DE5\u4F5C\uFF0C\u6267\u884C\u5783\u573E\u56DE\u6536\u3002 \u7531\u4E8E\u5728\u8FDB\u884C\u5783\u573E\u56DE\u6536\u7684\u65F6\u5019\u5FC5\u987B\u505C\u6B62\u7CFB\u7EDF\u7A0B\u5E8F\u7684\u8FD0\u884C\uFF0C\u5BFC\u81F4\u4E86\u57FA\u4E8E JVM \u8FD0\u884C\u7684\u7CFB\u7EDF\u6700\u5BB3\u6015\u7684\u7CFB\u7EDF\u5361\u987F\u95EE\u9898\u3002</p><p>\u65B0\u751F\u4EE3\u91C7\u7528\u7684\u590D\u5236\u7B97\u6CD5\u6548\u7387\u6781\u9AD8\uFF0C\u56E0\u4E3A\u65B0\u751F\u4EE3\u91CC\u5B58\u6D3B\u7684\u5BF9\u8C61\u5F88\u5C11\uFF0C\u53EA\u8981\u8FC5\u901F\u6807\u8BB0\u51FA\u8FD9\u5C11\u91CF\u5B58\u6D3B\u5BF9\u8C61\uFF0C\u79FB\u52A8\u5230 Survivor \u533A\uFF0C\u7136\u540E\u56DE\u6536\u6389\u5176\u4ED6\u5168\u90E8\u5783\u573E\u5BF9\u8C61\u5373\u53EF\uFF0C\u901F\u5EA6\u5F88\u5FEB\u3002</p><h3 id="young-gc-\u5BF9\u7CFB\u7EDF\u7684\u5F71\u54CD" tabindex="-1"><a class="header-anchor" href="#young-gc-\u5BF9\u7CFB\u7EDF\u7684\u5F71\u54CD" aria-hidden="true">#</a> Young GC \u5BF9\u7CFB\u7EDF\u7684\u5F71\u54CD</h3><p>\u5176\u5B9E\u5E74\u8F7B\u4EE3 gc \u51E0\u4E4E\u6CA1\u4EC0\u4E48\u597D\u8C03\u4F18\u7684\uFF0C\u56E0\u4E3A\u5B83\u7684\u8FD0\u884C\u903B\u8F91\u975E\u5E38\u7B80\u5355\uFF0C\u5C31\u662F Eden \u4E00\u65E6\u6EE1\u4E86\u65E0\u6CD5\u653E\u65B0\u5BF9\u8C61\u5C31\u89E6\u53D1\u4E00\u6B21 gc\u3002 \u56E0\u6B64\uFF0CYoung GC \u5BF9\u7CFB\u7EDF\u5F71\u54CD\u901A\u5E38\u6765\u8BF4\u662F\u4E0D\u5927\u7684\u3002</p><p>\u4E00\u822C\u6765\u8BF4\uFF0C\u771F\u8981\u8BF4\u5BF9\u5E74\u8F7B\u4EE3\u7684 gc \u8FDB\u884C\u8C03\u4F18\uFF0C\u53EA\u8981\u4F60\u7ED9\u7CFB\u7EDF\u5206\u914D\u8DB3\u591F\u7684\u5185\u5B58\u5373\u53EF\uFF0C\u6838\u5FC3\u70B9\u8FD8\u662F\u5728\u4E8E\u5806\u5185\u5B58\u7684\u5206\u914D\u3001\u65B0\u751F\u4EE3\u5185\u5B58\u7684\u5206\u914D\u3002 \u5185\u5B58\u8DB3\u591F\u7684\u8BDD\uFF0C\u901A\u5E38\u6765\u8BF4\u7CFB\u7EDF\u53EF\u80FD\u5728\u4F4E\u5CF0\u65F6\u671F\u5728\u51E0\u4E2A\u5C0F\u65F6\u624D\u6709\u4E00\u6B21\u65B0\u751F\u4EE3 gc\uFF0C\u9AD8\u5CF0\u671F\u6700\u591A\u4E5F\u5C31\u51E0\u5206\u949F\u4E00\u6B21\u65B0\u751F\u4EE3 gc\u3002\u800C\u4E00\u6B21\u65B0\u751F\u4EE3 gc \u53EF\u80FD\u4E5F\u5C31\u8017\u8D39\u51E0\u6BEB\u79D2\u3001\u51E0\u5341\u6BEB\u79D2\u3002</p>',10);function v(_,b){const p=r("ExternalLinkIcon");return t(),n(c,null,[i,a("p",null,[a("a",l,[u,o(p)])]),g],64)}var m=s(h,[["render",v]]);export{m as default};
